import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import AboutImg from "../assets/aboutus1.jpg";

function About() {
  return (
    <>
      <Navbar />
      <Hero
        cName="hero-mid"
        heroImg={AboutImg}
        title="About Us"
        btnClass="hide"
      />
    </>
  );
}

export default About;
